import React from "react";

function UserResult() {
  const fetchUsers = async () => {
    const response = await fetch(`${process.env.REACT_APP_GITHUB_URL}`);
  };
  return (
    <div>
      <h1>UserResult</h1>
    </div>
  );
}

export default UserResult;
